import { Button, Container } from "react-bootstrap";
import '../style/Home.css';

export default class Menu extends React.Component {
    render() {
        return (
            <>
                <Container className="home">

                    <Button>
                        Submit
                    </Button>
                </Container>
            </>
        );
    }

}
